Alternation, or alt for short, is represented with |, the second slowest infix, only faster than &. Alternation appends the lists produced by our two functions so that the left one is in front of the right one, and is the alternative monoid over the list functor . More intuitively, f | g tries f, and if f is rejected, tries g, backing up to exactly the same stack f had. This finally provides us a mean of error handling , and of managing the rejections we recieve from programs. The manipulation of rejections is how we achieve control flow in Prowl. A good place to start with alternation is to emulate the FP feature of pattern matching. We continue to try successive patterns until one fails. (;5) ( (as (x;) -> x + 1)) | (as (;x) -> x - 1)
) ==> 4 The above program attempts to match 5-right against x-left. The as-expression rejects the input, and the alternation moves on to the following case. The second as-expression accepts the input, destructures the right to reveal the 5, then binds to x and substitutes. You may notice this syntax to be a little awkward - and it is! The | infix does not work so great across lexical scoping, and so we introduce the [ ... ; ...] syntax as sugar. This is regex inspired, but there's no limitations on what may be inside. (;5) [ as (x;) -> x + 1; as (;x) -> x - 1
] ==> 4

