The n-times quantifier repeats a program the specified number of times, analogous to a for loop in imperative programming. It is semantically equivalent to concatenating the program with itself the given number of times, though the quantity can be runtime-determined. All quantifiers are space-sensitive, and must trail the previous program, touching it. program{n} will repeat program exactly n times, stopping and rejecting if any subprogram does. On n=0, the program becomes identity (), pushing and popping nothing and accepting all stacks. On n<0, the quantifier rejects the program. let s = (+ 1) -> 5 s{2}
5 (s{4} s{2}){3} ==> 7
23 As a note, in order for a program to be well-typed, the input program to all quantifiers must always be from a stack to a stack containing data of the same type - all data in the input and output stacks must have the same types in the same arrangement. ( -- ), ( int -- int), and (str int -- str int) are acceptable effects, ( int -- str ) is not.
